description:
An Alien creature has invaded Earth, and we must give him a smack down he will not soon forget....after all he came here uninvited, slap him silly or use different weapons to punish him or humiliate him,

- a hammer
- a high heel pump
- a lipstick

lets send this freak home, but not until we give him a warm and fuzzy &quot;welcome to earth&quot;

Enjoy and have fun !!!

